import React from 'react';


type ToDolistType = {
    title:string
    task:Array<TaskType>
}

type TaskType = {
    id:number;
    title:string;
    isDone:boolean
}


export  const ToDolist = (props:ToDolistType) => {



    return (
        <div>
            <h3>{props.title}</h3>
            <li>
                {props.task.map((el)=>{
                    return (
                        <div>
                            {el.title}
                        </div>
                    )
                })}
            </li>
        </div>
    );
};
